import * as React from 'react';

import { Card, Box, Avatar, Stack, Typography, IconButton, Divider, Chip, Switch } from '@mui/material';
import { LocationOn, Edit } from '@mui/icons-material';
import { grey } from '@mui/material/colors';

import useToken from './components/SignIn/useToken';
import SignIn from './components/SignIn/Signin'

import { Paper, Grid, Button } from '@mui/material';

export default function Invoices({token}) {

  if(!token) {
    //eturn <Login setToken={setToken} /> 
    return <Button variant="outlined" href="/signin">サインインする</Button>
  }

  return (
<Card>
  <Box sx={{ p: 2, display: 'flex' }}>
    <Avatar variant="rounded" src="avatar1.jpg" />
    <Stack spacing={0.5}>
      <Typography fontWeight={700}>token</Typography>
      <Typography variant="body2" color="text.secondary">
      <LocationOn sx={{color: grey[500]}} /> Scranton, PA
      </Typography>
    </Stack>
    <IconButton>
      <Edit sx={{ fontSize: 14 }} />
    </IconButton>
  </Box>
  <Divider />
  <Stack
    direction="row"
    alignItems="center"
    justifyContent="space-between"
    sx={{ px: 2, py: 1, bgcolor: 'background.default' }}
  >
    <Chip>Active account</Chip>
    <Switch />
  </Stack>
</Card>
    );
  }
